import React from 'react';
import ReactDOM from 'react-dom';
import { BrowserRouter } from 'react-router-dom';

import './index.css';
import App from './App';
import CategorySection from './CategorySection'; // 실제 파일 경로에 맞추세요.
import Box3 from './Box3'; // 실제 파일 경로에 맞추세요.
import reportWebVitals from './reportWebVitals';

// root 컨테이너에 App 컴포넌트를 렌더링합니다.
const rootContainer = document.getElementById('root');
if (rootContainer) {
  ReactDOM.render(
    <React.StrictMode>
      <BrowserRouter>
        <App />
      </BrowserRouter>
    </React.StrictMode>,
    rootContainer
  );
} else {
  console.error('Container element with id "root" not found.');
}

// Box3 컨테이너에 Box3 컴포넌트를 렌더링합니다.
const box3Container = document.getElementById('Box3');
if (box3Container) {
  ReactDOM.render(
    <React.StrictMode>
      <Box3 />
    </React.StrictMode>,
    box3Container
  );
} else {
  console.error('Container element with id "Box3" not found.');
}

// CategoryBox 컨테이너에 CategorySection 컴포넌트를 렌더링합니다.
const categoryBoxContainer = document.getElementById('category');
if (categoryBoxContainer) {
  ReactDOM.render(
    <React.StrictMode>
      <CategorySection />
    </React.StrictMode>,
    categoryBoxContainer
  );
} else {
  console.error('Container element with id "category" not found.');
}

reportWebVitals();
